import React from 'react';

const Hero = () => {
  return (
    <section className="bg-gray-200 dark:bg-gray-800 text-center py-16">
      <h1 className="text-4xl font-bold text-gray-900 dark:text-white">Welcome to My Portfolio</h1>
      <p className="text-lg text-gray-700 dark:text-gray-300 mt-4">I'm John Doe, a passionate developer.</p>
    </section>
  );
};

export default Hero;
